import styled from "styled-components";

import Link from "next/link";
import TextWelcome from "../components/pageSpecific/home/TextWelcome";
import Container from "../components/layout/Container";

const Home = (props) => {
  return (
    <Container>
      <Context>
        <Left>
          <TextWelcome />
        </Left>

        <Right>
          <Link href="/">Contact Us</Link>
          <Link href="/">Dealer Login</Link>
          <p>
            Our story starts 35 years ago, with a commitment to quality that has
            remained family owned and operated. Learn more about us{" "}
            <Link href="/sub/frank">here.</Link>{" "}
          </p>
        </Right>
      </Context>
    </Container>
  );
};

const Context = styled.div`
  display: grid;

  @media (min-width: 480px) {
    grid-template-columns: auto 25vw;
    grid-gap: 3rem;
  }
`;

const Left = styled.div``;

const Right = styled.div`
  display: none;
  grid-auto-flow: row;
  align-items: end;
  align-content: end;
  grid-gap: 1.5rem;
  @media (min-width: 480px) {
    display: grid;
  }
`;

export default Home;
